    var objList = <DbEvent>[];
    try {
      objList = list
          .map((dbevent) => DbEvent.fromMap(dbevent as Map<String, dynamic>))
          .toList();
    } catch (e) {
      print('SQFENTITY ERROR DbEvent.fromJson: ErrorMessage: ${e.toString()}');
